import React from "react";
import { NavLink } from "react-router-dom";
import NotificationIcon from '@material-ui/icons/Notifications';
import EmailIcon from '@material-ui/icons/Email';
import DropdownIcon from '@material-ui/icons/ArrowDropDownOutlined';

export const NavigationBar = () => {
  return (
        <>
        <nav class="navbar navbar-expand-lg navbar-light bg-light">
          <NavLink class="navbar-brand" to="#"><SearchIcon /></NavLink>
          <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation" >
            <span class="navbar-toggler-icon"></span>
          </button>

          <div class="collapse navbar-collapse" id="navbarSupportedContent">
            <ul class="navbar-nav mr-auto">
              <li class="nav-item active">
                <NavLink class="nav-link" to="/add">+ Add <span class="sr-only">(current)</span></NavLink>
              </li>
              <li class="nav-item">
                <NavLink class="nav-link" to="/email"><EmailIcon /></NavLink>
              </li>
              <li class="nav-item dropdown">
                <NavLink class="nav-link dropdown-toggle" to="/id" id="navbarDropdown" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                  Name
                </NavLink>
                <div class="dropdown-menu" aria-labelledby="navbarDropdown">
                  <NavLink class="dropdown-item" to="#">Action</NavLink>
                  <NavLink class="dropdown-item" to="#">Another action</NavLink>
                </div>
              </li>
              <li class="nav-item">
                <NavLink class="nav-link disabled" to="#" tabindex="-1" aria-disabled="true"><NotificationIcon /></NavLink>
              </li>
            </ul>
          </div>
        </nav>
    </>
  );
};

